    while ((pos = mdText.find("**", pos))!= std::string::npos) {
        htmlText += HTMLTag::B + mdText.substr(pos, pos + 2) + mdText.substr(pos + 2, mdText.find("\n", pos)) + "</" + HTMLTag::B + ">\n";
